
-- Table structure for table `y`
CREATE TABLE IF NOT EXISTS `y` (
  `id` INT AUTO_INCREMENT PRIMARY KEY,
  speciality VARCHAR(500),
  location VARCHAR(500),
  name VARCHAR(500),
  experience INT,
  clinic_name VARCHAR(500),
  doctor_address VARCHAR(500),
  consultation_fee INT,
  recommendation_percent INT,
  patient_stories INT,
  doctor_url VARCHAR(500),
  detailed_qualifications VARCHAR(500),
  contact_number VARCHAR(500),
  `created_at` TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

